                                                                                                                                                "\u041a\u043b\u0438\u0435\u043d\u0442 \u0438\u0434\u0435\u0442 \u043d\u0430 \u041f\u0440\u043e\u0433\u0443\u043b\u043a\u0443 \u0434\u043e\u0431\u0440\u043e\u0432\u043e\u043b\u044c\u043d\u043e \u0438 \u0441\u0430\u043c \u043d\u0435\u0441\u0435\u0442 \u043e\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0441\u0442\u044c \u0437\u0430 \u0441\u0435\u0431\u044f \u0438 \u0441\u0432\u043e\u0435 \u0438\u043c\u0443\u0449\u0435\u0441\u0442\u0432\u043e \u0432\u043e \u0432\u0440\u0435\u043c\u044f \u041f\u0440\u043e\u0433\u0443\u043b\u043a\u0438. \u0412  \u0441\u043b\u0443\u0447\u0430\u0435  \u0432\u043e\u0437\u043d\u0438\u043a\u043d\u043e\u0432\u0435\u043d\u0438\u044f  \u0441\u0438\u0442\u0443\u0430\u0446\u0438\u0439,  \u0432\u043e\u0437\u043c\u043e\u0436\u043d\u043e  \u0432\u043b\u0435\u043a\u0443\u0449\u0438\u0445  \u043d\u0435\u0431\u043b\u0430\u0433\u043e\u043f\u0440\u0438\u044f\u0442\u043d\u044b\u0435  \u043f\u043e\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u0438\u044f  \u0434\u043b\u044f  \u0441\u043e\u0441\u0442\u043e\u044f\u043d\u0438\u044f \u043a\u043b\u0438\u0435\u043d\u0442\u0430 (\u0441\u0442\u0440\u0430\u0445, \u0442\u0440\u0430\u0432\u043c\u0430, \u043d\u0435\u0441\u0442\u0430\u0431\u0438\u043b\u044c\u043d\u043e\u0435 \u043f\u0441\u0438\u0445\u0438\u0447\u0435\u0441\u043a\u043e\u0435 \u0441\u043e\u0441\u0442\u043e\u044f\u043d\u0438\u0435 \u0438 \u0442.\u043f.), \u041a\u043b\u0438\u0435\u043d\u0442 \u043e\u0431\u044f\u0437\u0443\u0435\u0442\u0441\u044f  \u043d\u0435\u0437\u0430\u043c\u0435\u0434\u043b\u0438\u0442\u0435\u043b\u044c\u043d\u043e  \u043e\u043f\u043e\u0432\u0435\u0441\u0442\u0438\u0442\u044c  \u043e\u0431 \u044d\u0442\u043e\u043c \u0413\u0438\u0434\u0430."
