                                                                                                                                                "\u0412\u043e \u0438\u0437\u0431\u0435\u0436\u0430\u043d\u0438\u0435 \u043f\u043e\u043b\u0443\u0447\u0435\u043d\u0438\u044f/\u043f\u0440\u0438\u0447\u0438\u043d\u0435\u043d\u0438\u044f \u0442\u0440\u0430\u0432\u043c \u041a\u043b\u0438\u0435\u043d\u0442 \u043e\u0431\u044f\u0437\u0443\u0435\u0442\u0441\u044f \u043d\u0435 \u0438\u043c\u0435\u0442\u044c \u043f\u0440\u0438 \u0441\u0435\u0431\u0435 \u043a\u043e\u043b\u044e\u0449\u0438\u0435 \u0438 \u0440\u0435\u0436\u0443\u0449\u0438\u0435 \u043f\u0440\u0435\u0434\u043c\u0435\u0442\u044b, \u0440\u0430\u0441\u043f\u044b\u043b\u0438\u0442\u0435\u043b\u0438, \u0433\u0430\u0437\u043e\u0432\u044b\u0435 \u0431\u0430\u043b\u043b\u043e\u043d\u0447\u0438\u043a\u0438, \u0436\u0438\u0434\u043a\u043e\u0441\u0442\u0438."
