                                                                                                                                                "\u0414\u0435\u0442\u0438 \u043e\u0442 7 \u0434\u043e 11 \u043b\u0435\u0442 \u0432\u043a\u043b\u044e\u0447\u0438\u0442\u0435\u043b\u044c\u043d\u043e \u0434\u043e\u043f\u0443\u0441\u043a\u0430\u044e\u0442\u0441\u044f \u043a \u041f\u0440\u043e\u0433\u0443\u043b\u043a\u0430\u043c \u0442\u043e\u043b\u044c\u043a\u043e \u0432 \u0441\u043e\u043f\u0440\u043e\u0432\u043e\u0436\u0434\u0435\u043d\u0438\u0438 \u0432\u0437\u0440\u043e\u0441\u043b\u044b\u0445. \u041a\u043b\u0438\u0435\u043d\u0442, \u0441\u043e\u043f\u0440\u043e\u0432\u043e\u0436\u0434\u0430\u044e\u0449\u0438\u0439 \u0440\u0435\u0431\u0435\u043d\u043a\u0430, \u043d\u0435\u0441\u0435\u0442 \u0437\u0430 \u043d\u0435\u0433\u043e \u043e\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0441\u0442\u044c."
