                                                                                                                                                { style: { textAlign: "justify", marginBottom: "0" } },
                                                                                                                                                "\u0412 \u0441\u043b\u0443\u0447\u0430\u0435 \u043d\u0435\u0430\u0434\u0435\u043a\u0432\u0430\u0442\u043d\u043e\u0433\u043e \u043f\u043e\u0432\u0435\u0434\u0435\u043d\u0438\u044f \u0440\u0435\u0431\u0435\u043d\u043a\u0430 \u0432\u043e \u0432\u0440\u0435\u043c\u044f \u044d\u043a\u0441\u043a\u0443\u0440\u0441\u0438\u0438 (\u043f\u0440\u0438 \u0430\u0433\u0440\u0435\u0441\u0441\u0438\u0432\u043d\u043e\u043c \u043f\u043e\u0432\u0435\u0434\u0435\u043d\u0438\u0438 \u0440\u0435\u0431\u0435\u043d\u043a\u0430 \u043f\u043e \u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u044e \u043a \u0434\u0440\u0443\u0433\u0438\u043c \u043f\u043e\u0441\u0435\u0442\u0438\u0442\u0435\u043b\u044f\u043c, \u0435\u0441\u043b\u0438 \u0440\u0435\u0431\u0435\u043d\u043e\u043a \u043c\u0435\u0448\u0430\u0435\u0442 \u0434\u0440\u0443\u0433\u0438\u043c \u043f\u043e\u0441\u0435\u0442\u0438\u0442\u0435\u043b\u044f\u043c, \u043a\u0440\u0438\u0447\u0438\u0442, \u0441\u043e\u0437\u0434\u0430\u0435\u0442 \u043e\u043f\u0430\u0441\u043d\u043e\u0441\u0442\u044c \u043d\u0430\u043d\u0435\u0441\u0435\u043d\u0438\u044f \u0432\u0440\u0435\u0434\u0430 \u0441\u0432\u043e\u0435\u043c\u0443 \u0437\u0434\u043e\u0440\u043e\u0432\u044c\u044e \u0438\u043b\u0438 \u0437\u0434\u043e\u0440\u043e\u0432\u044c\u044e \u0438 \u0438\u043c\u0443\u0449\u0435\u0441\u0442\u0432\u0443 \u0442\u0440\u0435\u0442\u044c\u0438\u0445 \u043b\u0438\u0446) \u0413\u0438\u0434 \u0432\u043f\u0440\u0430\u0432\u0435 \u043f\u0440\u0435\u043a\u0440\u0430\u0442\u0438\u0442\u044c \u044d\u043a\u0441\u043a\u0443\u0440\u0441\u0438\u044e \u0434\u043b\u044f \u044d\u0442\u043e\u0433\u043e \u0440\u0435\u0431\u0435\u043d\u043a\u0430 \u0438/\u0438\u043b\u0438 \u0432\u044b\u0432\u0435\u0441\u0442\u0438 \u0435\u0433\u043e \u0438\u0437 \u0442\u0435\u043c\u043d\u043e\u0439 \u0447\u0430\u0441\u0442\u0438 \u0432\u044b\u0441\u0442\u0430\u0432\u043a\u0438."
